const pngsToTiff = async (date) => {
    const inputFolder = 'puppeteerImages/*.png';
    const outputTiffPath = 'puppeteerTiffs/puppeteer-imageMagick.tiff';

    const command = `convert ${inputFolder} ${outputTiffPath}`;

    exec(command, (error, stdout, stderr) => {
        if (error) {
            console.error(`Error: ${error.message}`);
            return;
        }
        if (stderr) {
            console.error(`stderr: ${stderr}`);
            return;
        }
        console.log(`stdout: ${stdout}`);
        console.log("Total time", new Date()-date)
    });
}

const createTiffs = async(date) => {
    // Launch a headless browser
    const browser = await puppeteerSharp.launch({
        timeout: 0,
        protocolTimeout: 0,
        headless: true,
        args: [
            '--no-sandbox',
            '--disable-web-security',
            // '--disable-dev-shm-usage',
            '--js-flags="--max-old-space-size=4096"',
            '--debug-print'
        ],
    });

    // Open a new page
    const page = await browser.newPage();

    // Set viewport size
    await page.setViewport({ width: 640, height: 480, deviceScaleFactor: 2 });

    // Navigate to the HTML file or URL
    await page.setContent( html, { waitUntil: 'networkidle0' });
    await page.addStyleTag({
        content: `
              .layoutCanvas_canvas__rptS3 {
                page-break-after: always;
              }
          `
    });

    // Optionally, wait for some time or events to ensure the page is fully loaded
    // e.g., await page.waitForTimeout(5000);

    // Function to take screenshots of each section
    async function takeScreenshots() {
        const sections = await page.$$('#content'); // Adjust selector as needed

        for (let i = 0; i < sections.length; i++) {
            const section = sections[i];

            // Capture screenshot
            await section.screenshot({ path: `puppeteerImages/screenshot${i + 1}.png` });
        }
        
    }

    // Call the function to take screenshots
    await takeScreenshots();

    // Close the browser
    await browser.close();

    console.log("screenshot generation took time", new Date() - date)

    await pngsToTiff(date);
}

createTiffs(new Date());